import React, { useState } from 'react';
import { Link, useNavigate } from 'react-router-dom'; // Import useNavigate
import Header from '../components/common/header'; // Assuming the same header is used
import { createClient } from '@supabase/supabase-js';

// Initialize Supabase client
const supabaseUrl = 'https://klligruouvwvqrwrxqcj.supabase.co'; // Replace with your Supabase project URL
const supabaseAnonKey = 'eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJpc3MiOiJzdXBhYmFzZSIsInJlZiI6ImtsbGlncnVvdXZ3dnFyd3J4cWNqIiwicm9sZSI6ImFub24iLCJpYXQiOjE3MDc1MDg5NTQsImV4cCI6MjAyMzA4NDk1NH0.9DI6I1eD9mr6wzlvePSMTdr6DQctU4Mh9vGv8XD8WJ4'; // Replace with your Supabase anon key
const supabase = createClient(supabaseUrl, supabaseAnonKey);

const SignupPage = () => {
    const [email, setEmail] = useState('');
    const [password, setPassword] = useState('');
    const [error, setError] = useState('');
    const navigate = useNavigate(); // Initialize the useNavigate hook

    const handleSubmit = async (e) => {
        e.preventDefault();
        const { user, error } = await supabase.auth.signUp({
            email,
            password,
        });

        if (error) {
            setError(error.message);
        } else {
            console.log('Signup successful:', user);
            navigate('/'); // Redirect to the homepage
        }
    };

    const handleGoogleSignIn = async () => {
        const { user, error } = await supabase.auth.signIn({
            provider: 'google',
        });

        if (error) {
            setError(error.message);
        } else {
            console.log('Google sign in successful:', user);
            navigate('/'); // Redirect to the homepage
        }
    };

    return (
        <div className="min-h-screen flex flex-col bg-black">
            <Header />
            <div className="flex-grow container mx-auto p-4 text-center">
                {/* Content remains the same */}
            </div>
            <footer className="bg-gray-200 text-center p-4">
                Â© 2024 Bruh (bRUH), Inc.
            </footer>
        </div>
    );
};

export default SignupPage;
